import React from 'react';
import './App.css';

class App extends React.Component {
  componentDidMount() {
    const script = document.createElement("script");
    script.src = "main.js";
    script.async = true;
    script.onload = () => this.scriptLoaded();

    document.body.appendChild(script);
  }

  render(){
    return (
      <div className="App">Welcome to typeracer!</div>
    );
  }
}

// const App = () => {
//   return (<div className="App">Welcome to typeracer!</div>);
//   }
export default App;
